import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
            <div
                className="col-md-6 d-flex flex-column justify-content-center align-items-center"
                style={{
                    padding: "70px",
                    paddingLeft: "200px",
                    paddingRight: "200px",
                }}
            >
                
            </div>
        );
    }
}

export default Home;
